import { useState } from 'react';

function App() {
	return (
		<div>
			<h1>Selecciona los ingredientes de la tortilla de patata</h1>

			<form className="formContainer" action="">
				<input type="checkbox" name="false" id="macarrones" />
				<label htmlFor="macarrones">Macarrones</label>
				<input type="checkbox" name="true" id="patatas" />
				<label htmlFor="patatas">Patatas</label>
			</form>
		</div>
	);
}

export default App;
